```rust
use std::collections::HashMap;
use reqwest::Client;
use tokio::prelude::*;

pub struct TTS {
    client: Client,
    voices: HashMap<String, Voice>,
}

impl TTS {
    pub fn new(voice: Voice) -> Self {
        let client = Client::new();
        let mut voices = HashMap::new();
        voices.insert(voice.name.clone(), voice);
        TTS { client, voices }
    }

    pub async fn speak(&self, text: String) -> Result<(), Box<dyn std::error::Error>> {
        let voice = self.voices.values().next().unwrap();
        let url = format!("https://api.elevenlabs.io/v1/tts?text={}&voice={}", text, voice.name);
        let response = self.client.get(url).send().await?;
        let audio_data = response.bytes().await?;
        // Play the audio data using a library like rodio or cpal
        // For this example, we'll just print the audio data
        println!("Audio data: {:?}", audio_data);
        Ok(())
    }
}

pub struct Voice {
    pub name: String,
    pub language: String,
    pub gender: String,
}

impl Voice {
    pub fn default() -> Self {
        Voice {
            name: "en-US".to_string(),
            language: "English".to_string(),
            gender: "Male".to_string(),
        }
    }
}
```

