Here are a few popular compiler optimization techniques, along with example codes and explanations:

**1. Constant Folding**

Constant folding is a technique where the compiler evaluates constant expressions at compile-time, rather than at runtime.

Example:
```c
int x = 2 + 3;
```
The compiler can evaluate the expression `2 + 3` at compile-time and replace it with the constant value `5`. The resulting machine code will simply load the value `5` into the variable `x`.

Why it's useful: Reduces the number of operations at runtime, making the code faster.

**2. Dead Code Elimination**

Dead code elimination is a technique where the compiler removes code that is never executed.

Example:
```c
int x = 5;
if (0) {
    x = 10;
}
```
The compiler can see that the `if` statement is always false, so the code inside the `if` block is never executed. The compiler can remove this code, resulting in:
```c
int x = 5;
```
Why it's useful: Reduces the size of the generated machine code, making the program smaller and faster.

**3. Loop Unrolling**

Loop unrolling is a technique where the compiler increases the number of iterations in a loop to reduce the overhead of the loop control statements.

Example:
```c
for (int i = 0; i < 10; i++) {
    x[i] = i;
}
